		/// <remarks>
		/// According to how I understood this in the freemode script alone,<br/>
		/// The first parameter is determined by a function named, func_5749 within the freemode script which has a list of all the vehicles and a set price to return which some vehicles deals with globals as well. So the first parameter is basically the set in stone insurance cost it's gonna charge you for that specific vehicle model.<br/>
